import React from 'react'
import {data} from "../../store/store";
import s from "./Product.module.css"

class Product extends React.Component{
    constructor (){
        this.state = {
            willBuy: false
        }
    }

    render() {
        return (
            <div className={s.containerProduct} >
                <div>{this.el.title} </div>
                <img src={this.el.image_main}  alt="ddd"/>

                <div>
                    <div>
                        {this.state.willBuy}
                        <button className={s.addCart} onClick={this.productToWillBuy.bind(null, this.el)}>Will Buy</button>
                    </div>

                    <button className={s.delete} onClick={this.removeElement.bind(null, this.el)}>
                        Delete
                    </button>
                </div>
            </div>
        );
    }
}



export default Product;
